import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Open the cart modal by clicking the cart element (using .cart class and text "Cart")
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for the cart modal to appear (look for heading "Your cart" or cart modal container)
    // Try both text and class-based strategies
    let cartModalSelector = null;
    if (await page.$('text=Your cart')) {
      cartModalSelector = 'text=Your cart';
    } else if (await page.$('.cart-content')) {
      cartModalSelector = '.cart-content';
    } else if (await page.$('#cartModal')) {
      cartModalSelector = '#cartModal';
    }
    if (cartModalSelector) {
      await page.waitForSelector(cartModalSelector, { timeout: 5000 });
    }

    // Take screenshot after opening cart
    const step2 = path.join(screenshotsDir, 'step_2_cart_opened.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for at least one "Remove" button in the cart (using button text and .remove-item class)
    let removeBtn = await page.$('button:has-text("Remove")');
    if (!removeBtn) {
      removeBtn = await page.$('.remove-item');
    }

    // If there is no remove button, cart is empty; extract info and finish
    if (!removeBtn) {
      // Extract cart empty message if present
      let cartEmptyMsg = '';
      const emptyCartDiv = await page.$('.empty-cart');
      if (emptyCartDiv) {
        cartEmptyMsg = await emptyCartDiv.textContent();
      }
      const step3 = path.join(screenshotsDir, 'step_3_cart_empty.png');
      await page.screenshot({ path: step3 });
      screenshots.push(step3);
      return {
        success: true,
        action: "Cart was already empty, no item to remove",
        extractedData: { cartEmptyMsg },
        screenshots,
        error: null
      };
    }

    // Extract the title of the first cart item before removal
    let cartItemTitle = '';
    const cartItemTitleEl = await page.$('.cart-item-title');
    if (cartItemTitleEl) {
      cartItemTitle = (await cartItemTitleEl.textContent()).trim();
    }

    // Click the first remove button
    await removeBtn.click();

    // Wait for the cart to update: either the item disappears or "Your cart is empty" message appears
    // Wait for either .empty-cart or for .cart-item-title to be detached
    await Promise.race([
      page.waitForSelector('.empty-cart', { timeout: 5000 }),
      page.waitForSelector('.cart-item-title', { state: 'detached', timeout: 5000 })
    ]);

    // Take screenshot after removal
    const step4 = path.join(screenshotsDir, 'step_4_item_removed.png');
    await page.screenshot({ path: step4 });
    screenshots.push(step4);

    // Extract the cart state after removal
    let cartAfterMsg = '';
    const emptyCartAfter = await page.$('.empty-cart');
    if (emptyCartAfter) {
      cartAfterMsg = (await emptyCartAfter.textContent()).trim();
    }
    // Also, check if any cart-item-title remains
    const remainingCartItem = await page.$('.cart-item-title');
    let remainingTitle = '';
    if (remainingCartItem) {
      remainingTitle = (await remainingCartItem.textContent()).trim();
    }

    return {
      success: true,
      action: "Removed first item from cart (if present)",
      extractedData: {
        removedItemTitle: cartItemTitle,
        cartEmptyMsg: cartAfterMsg,
        remainingCartItemTitle: remainingTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
